/////////////////////////////////////////////////////////////////////////////////////
// Object construction
/////////////////////////////////////////////////////////////////////////////////////
gcgTEXT::gcgTEXT() {
  x = y = z = 0;            // Next print position
  scalex = scaley = 1.0f;   // Font scale.
  textangle = 0.f;          // Text orientation
  borderpixels[0] = 1;      // Number of pixels in separation
  borderpixels[1] = 1;
  wrap = TRUE;              // Wrap text to box?
  noTextBox = TRUE;         // Text box enabled?
  currentfont = NULL;       // No font yet
}

/////////////////////////////////////////////////////////////////////////////////////
// Plot release.
/////////////////////////////////////////////////////////////////////////////////////
gcgTEXT::~gcgTEXT() {
}


/////////////////////////////////////////////////////////////////////////////////////
// Set font from a gcgFONT object
/////////////////////////////////////////////////////////////////////////////////////
bool gcgTEXT::setFont(gcgFONT *font) {
  // Check font
  if(font == NULL) return false;
  if(font->basewidths == NULL || font->textureID == 0 || font->nchars == 0 || font->charheight == 0) return false;

  // Ok, set font
  currentfont = font;
  return true;
}

/////////////////////////////////////////////////////////////////////////////////////
// Set system font from index
/////////////////////////////////////////////////////////////////////////////////////
bool gcgTEXT::setSystemFont(int ifont) {
  if(ifont < 0 || ifont >= GCG_SYSTEM_FONTS) return false;

  // This is needed to allow multiple OpenGL contexts
  gcgOPENGLCONTEXT *ogl;
  GET_OPENGL_CONTEXT(ogl);

  currentfont = ogl->systemfonts[ifont];
  if(currentfont == NULL) {
    currentfont = ogl->systemfonts[ifont] = new gcgFONT();
    if(currentfont == NULL) {
      gcgReport(GCG_REPORT_CODE(GCG_ERROR, GCG_DOMAIN_MEMORY, GCG_ALLOCATIONERROR), "gcgDrawLogo(): constructor failed. (%s:%d)", basename((char*)__FILE__), __LINE__);
      return false;
    }
  } else 
      if(currentfont->basewidths != NULL && currentfont->textureID != 0) return true; // Already loaded

  // Load for the very first time...
	return currentfont->createFromData((GCGFONTDATA*) registeredfonts[ifont]);
}


/////////////////////////////////////////////////////////////////////////////////////
// Selects the best normal system font and scaling that fits to the width passed.
// Returns the scaling factor used.
/////////////////////////////////////////////////////////////////////////////////////
float gcgTEXT::setBestFitSystemFont(char *str, float width) {
  if(str == NULL || width <= 0.0) return 0.0;

  float f, factor = (float) INF;
  unsigned int w, h, fontindex = 0, ssize = (unsigned int) strlen(str);
  for(int i = 0; i < BEST_FIT_FONTS; i++) {
    if(this->setSystemFont(bestfitfonts[i])) {
      currentfont->textLength(&w, &h, str, ssize); // Must fit at least these characters
      f = (float) width / (float) w; // Compute general factor
      if(fabs(f - 1.0) < fabs(factor - 1.0)) {
        // Is it closer to 1.0 factor
        factor = f;
        fontindex = bestfitfonts[i];
      }
    }
  }
  // Select the best font and scaling
  if(!setSystemFont(fontindex)) return 0.0;

  fontScale(factor, factor);
  return factor;
}

/////////////////////////////////////////////////////////////////////////////////////
// Set font scales.
/////////////////////////////////////////////////////////////////////////////////////
void gcgTEXT::fontScale(float sx, float sy) {
  scalex = sx;
  scaley = sy;
}

/////////////////////////////////////////////////////////////////////////////////////
// Enables a 2D box region for text output.
/////////////////////////////////////////////////////////////////////////////////////
void gcgTEXT::enableTextBox(float xbox, float ybox, float width, float height) {
  textbox[0] = (float) (int)((float) xbox+0.5f);  textbox[1] = (float) (int)((float)ybox+0.5f);
  textbox[2] = (float) (int)((float) xbox+0.5f) + width; textbox[3] = (float) (int)((float) ybox+0.5f) + height;
  noTextBox = FALSE;
  borderpixels[0] = 1; borderpixels[1] = 1;
  textPosition(0.f, 0.f);
  textOrientation(0.f);
  z = 0.f; // 2D version
}

/////////////////////////////////////////////////////////////////////////////////////
// Enables a 2D box region for text output with upper left corner at the projection
// of a 3D point. The xy offsets helps to correctly position the 2D box.
/////////////////////////////////////////////////////////////////////////////////////
void gcgTEXT::enableTextBoxAt3DPos(float xpos, float ypos, float zpos, float width, float height) {
  double  projd[16], modd[16];
  double  xj, yj, zj;

  // Retrieve current projection parameters
	glGetDoublev(GL_PROJECTION_MATRIX, projd);
	glGetDoublev(GL_MODELVIEW_MATRIX, modd);
	glGetIntegerv(GL_VIEWPORT, viewport);

	// Projects the point onto screen
	if(gluProject(xpos, ypos, zpos, modd, projd, viewport, &xj, &yj, &zj)) {
		  // Now box can be set up
		  enableTextBox((float) xj - viewport[0], viewport[3]  - (float) yj, width, height);
		  z = (float) zj;   // 3D version here.
  }
}

/////////////////////////////////////////////////////////////////////////////////////
// Moves a 2D box by xy offsets.
/////////////////////////////////////////////////////////////////////////////////////
void gcgTEXT::adjustTextBox(float xoffset, float yoffset, float widthoffset, float heightoffset) {
  textbox[0] += (int) (xoffset + 0.5);
  textbox[1] += (int) (yoffset + 0.5);
  textbox[2] += (int) (xoffset + widthoffset + 0.5);
  textbox[3] += (int) (yoffset + heightoffset + 0.5);
}

/////////////////////////////////////////////////////////////////////////////////////
// Sets the number of pixels to separate text from borders.
/////////////////////////////////////////////////////////////////////////////////////
void gcgTEXT::setBorder(int npixelsX, int npixelsY) {
  borderpixels[0] = npixelsX;
  borderpixels[1] = npixelsY;
}

/////////////////////////////////////////////////////////////////////////////////////
// Disables a 2D box and sets whole viewport for text output.
/////////////////////////////////////////////////////////////////////////////////////
void gcgTEXT::disableTextBox() {
  noTextBox = TRUE;
  // Loads the viewport
  glGetIntegerv(GL_VIEWPORT, viewport);
  textbox[0] = 0; textbox[1] = 0;
  textbox[2] = (float) (viewport[2] - viewport[0]);
  textbox[3] = (float) (viewport[3] - viewport[1]);

  textPosition(0.f, 0.f);
  textOrientation(0.f);
  z = 0.f; // 2D version
}

/////////////////////////////////////////////////////////////////////////////////////
// Draws the current text output region using blending with transparency. A color
// is given to fill the box and another color is given to color the line entouring
// the box. The linewidth parameter sets the frame width.
/////////////////////////////////////////////////////////////////////////////////////
void gcgTEXT::drawTextBox(float boxR, float boxG, float boxB, float boxA, float frameR, float frameG, float frameB, float frameA, float linewidth) {
  if(noTextBox) return;

	glMatrixMode(GL_PROJECTION);
	glPushMatrix();
	glLoadIdentity();

  glGetIntegerv(GL_VIEWPORT, viewport);
	glOrtho(0.0, viewport[2]-viewport[0], -(viewport[3] - viewport[1]), 0, 0.f, -1.f);

  glDisable(GL_TEXTURE_2D);
  glFrontFace(GL_CCW);
	glEnable(GL_BLEND);
	glBlendFunc(GL_SRC_ALPHA, GL_ONE_MINUS_SRC_ALPHA);

	glPolygonMode(GL_FRONT_AND_BACK, GL_FILL);

	glEnable(GL_POLYGON_OFFSET_FILL);

	float factor, units;
	glGetFloatv(GL_POLYGON_OFFSET_FACTOR, &factor);
	glGetFloatv(GL_POLYGON_OFFSET_UNITS, &units);

	glPolygonOffset((float) EPSILON, 0.5f);//0.1875); // Empirically discovered for depth buffer of 24 and 16bits

	glMatrixMode(GL_MODELVIEW);
	glPushMatrix();
	glLoadIdentity();
	glTranslatef(textbox[0], -textbox[1], z);
	glRotatef(textangle, 0.0f, 0.0f, 1.0f);

	//glColorMask(GLboolean red, GLboolean green, GLboolean blue, GLboolean alpha);
  //glDepthMask(GL_FALSE);

	glColor4f(frameR, frameG, frameB, frameA);
  if(fabs(linewidth - 1.0f) > EPSILON) {
	 glEnable(GL_LINE_SMOOTH);
	 glLineWidth(linewidth);
  }
	glBegin(GL_LINE_STRIP);
		glVertex2f(0.f, 0.f);
		glVertex2f(0.f, textbox[1]-textbox[3]);
		glVertex2f(textbox[2] - textbox[0], textbox[1]-textbox[3]);
		glVertex2f(textbox[2] - textbox[0], 0.f);
		glVertex2f(0.f, 0.f);
	glEnd();

  glDisable(GL_LINE_SMOOTH);
	glLineWidth(1.0f);

  glColor4f(boxR, boxG, boxB, boxA);
 	glBegin(GL_QUADS);
 	  glVertex2f(0.f, 0.f);
 	  glVertex2f(0.f, textbox[1]-textbox[3]);
 	  glVertex2f(textbox[2] - textbox[0], textbox[1]-textbox[3]);
		glVertex2f(textbox[2] - textbox[0], 0.f);
	glEnd();

  glPolygonOffset(factor, units);
	glDisable(GL_POLYGON_OFFSET_FILL);

//	glDepthMask(GL_TRUE);
	// Restaura matriz de projecao
	glMatrixMode(GL_PROJECTION);
	glPopMatrix();

	// Restaura matriz de modelo visualizacao
  glMatrixMode(GL_MODELVIEW);
	glPopMatrix();
}

/////////////////////////////////////////////////////////////////////////////////////
// Flags the wrapping functionality
/////////////////////////////////////////////////////////////////////////////////////
void gcgTEXT::wrapText(bool wraptobox) {
  wrap = wraptobox;
}


/////////////////////////////////////////////////////////////////////////////////////
// Set text position in pixels (except z coordinate)
/////////////////////////////////////////////////////////////////////////////////////
void gcgTEXT::textPosition(float tx, float ty) {
  x = tx;
  y = ty;
}

/////////////////////////////////////////////////////////////////////////////////////
// Set text orientation
/////////////////////////////////////////////////////////////////////////////////////
void gcgTEXT::textOrientation(float angle) {
  textangle = angle;
}

/////////////////////////////////////////////////////////////////////////////////////
// Initialization for all text output functions
/////////////////////////////////////////////////////////////////////////////////////
void gcgTEXT::initTextOutput() {
  // Check default system font
  if(currentfont == NULL) setSystemFont(GCG_DEFAULT_FONT);

	glMatrixMode(GL_TEXTURE);
	glPushMatrix();
	glLoadIdentity();

	glMatrixMode(GL_PROJECTION);
	glPushMatrix();
	glLoadIdentity();

  glGetIntegerv(GL_VIEWPORT, viewport);
	glOrtho(0.0, viewport[2]-viewport[0], -(viewport[3] - viewport[1]), 0, 0.f, -1.f);

	glEnable(GL_BLEND);
	glBlendFunc(GL_SRC_ALPHA, GL_ONE_MINUS_SRC_ALPHA);

	glEnable(GL_TEXTURE_2D);
	glFrontFace(GL_CCW);
	glPolygonMode(GL_FRONT_AND_BACK, GL_FILL);
	glShadeModel(GL_SMOOTH);

	// Seleciona a textura da fonte
	glBindTexture(GL_TEXTURE_2D, currentfont->textureID);
	glTexEnvf(GL_TEXTURE_ENV, GL_TEXTURE_ENV_MODE, GL_MODULATE);

	// Prepara transformacao de modelo
	glMatrixMode(GL_MODELVIEW);
	glPushMatrix();
	glLoadIdentity();

	// Posiciona o texto em (0, 0 -	superior/esquerdo)
	glTranslatef(textbox[0] + borderpixels[0], -textbox[1] - borderpixels[1], z);
	glRotatef(textangle, 0.f, 0.f, 1.f);
	glScalef(scalex, -scaley, 1.f);
	glTranslatef(x, y + currentfont->charheight, 0.f);

	glListBase(currentfont->font_base - currentfont->firstASCII);
}

/////////////////////////////////////////////////////////////////////////////////////
// Finishing the text output for all functions
/////////////////////////////////////////////////////////////////////////////////////
void gcgTEXT::finishTextOutput() {
	glListBase(0);

	glDisable(GL_BLEND);
	glDisable(GL_TEXTURE_2D);

	// Restaura matriz de projecao
	glMatrixMode(GL_PROJECTION);
	glPopMatrix();

	glMatrixMode(GL_TEXTURE);
  glPopMatrix();

	glMatrixMode(GL_MODELVIEW);
  glPopMatrix();
}


/////////////////////////////////////////////////////////////////////////////////////
// Prints text to the output area. Implements the wrap functionality.
/////////////////////////////////////////////////////////////////////////////////////
void gcgTEXT::outputText(int length, char *str) {
  int tamtexto;
  unsigned int w, h;

  currentfont->textLength(&w, &h, str, length);
  if(!wrap && textbox[1] + borderpixels[1] + (y + h) * scaley > textbox[3]) return;

  while(textbox[0] + borderpixels[0] + (x + w) * scalex > textbox[2]) {
    tamtexto = currentfont->charsThatFit((textbox[2] - textbox[0]) / scalex - x - borderpixels[0], str, length);
    if(tamtexto == 0) break;

    glCallLists(tamtexto, GL_UNSIGNED_BYTE, str);	// Desenha o texto usando a lista de caracteres
    currentfont->textLength(&w, &h, str, tamtexto);
    glTranslatef(-x - w,  (float) h, 0.f);
    str += tamtexto;
    length -= tamtexto;
    currentfont->textLength(&w, &h, str, length);
    if(!wrap) return;
    y += h;
    if(textbox[1] + borderpixels[1] + (y + h) * scaley > textbox[3]) {
      y = 0;
      glLoadIdentity();
      glTranslatef(textbox[0] + borderpixels[0], -textbox[1] - borderpixels[1], z);
      glRotatef(textangle, 0.f, 0.f, 1.f);
    	glScalef(scalex, -scaley, 1.f);
	    glTranslatef(0.f, (float) h, 0.f);
    }
    x = 0;
  }

  glCallLists(length, GL_UNSIGNED_BYTE, str);	// Desenha o texto usando a lista de caracteres
  x += w;
}



/////////////////////////////////////////////////////////////////////////////////////
// Function for text output. As easy as printf.
/////////////////////////////////////////////////////////////////////////////////////
void gcgTEXT::gcgprintf(const char *format, ...) {
  char    buffer[256]; // If length is less than 256
	char		*str, *str2, *texto = buffer;
	int     length, size = 256;  // Initial guess for string length
	unsigned int w, h;
	va_list	va;

	// Checks format
	if(!format) return;

	// Parse input string reallocating memory to fit output
  do {
      int n;

      // Try to print in the allocated space.
      va_start(va, format);
      n = vsnprintf(texto, size, format, va);
      va_end(va);

      // If that worked, return the string.
      if(n > -1 && n < size) break;

      // Else try again with more space.
      if(n > -1) size = n + 1;   // glibc 2.1
      else size = size + 256;    // glibc 2.0

      if(texto == buffer) texto = (char*) ALLOC(size * sizeof(char));
      else texto = (char*) REALLOC(texto, sizeof(char) * size);
      if(!texto) return;
  } while(TRUE);

  initTextOutput();

  if(noTextBox) {
    // Loads the viewport, every time
    textbox[0] = 0; textbox[1] = 0;
    textbox[2] = (float) (viewport[2] - viewport[0]);
    textbox[3] = (float) (viewport[3] - viewport[1]);
    z = 0.0;  // 2D version
  }

  str = texto; str2 = strchr(str, '\n');
	while(str2) {
    str2[0] = '\0';
    length = (int) strlen(str);
    outputText(length, str);
    currentfont->textLength(&w, &h, str, length);
    glTranslatef(-x, (float) h, 0.f);

    x = 0;
    y += h;
    if(wrap && textbox[1] + borderpixels[1] + (y + h) * scaley > textbox[3]) {
      y = 0;
      glLoadIdentity();
      glTranslatef(textbox[0] + borderpixels[0], -textbox[1] - borderpixels[1], z);
      glRotatef(textangle, 0.f, 0.f, 1.f);
    	glScalef(scalex, -scaley, 1.f);
	    glTranslatef(0, (float) h, 0.f);
    }
    str = str2 + 1;
    str2 = strchr(str, '\n');
  }
	outputText((int) strlen(str), str);

	if(texto != buffer) SAFE_FREE(texto); // Release string memory

	finishTextOutput();
}

