/////////////////////////////////////////////////////////////////////////////////////
// Generates C code for internal registration of the font
/////////////////////////////////////////////////////////////////////////////////////
bool gcgGenerateSystemFontCode(char *name, GCGFONTDATA *gcgfont) {
  // Check font information and parameters
  if(name == NULL || gcgfont == NULL) return false;
  if(gcgfont->cellwidth == 0 || gcgfont->cellheight == 0 || gcgfont->width == 0 || gcgfont->height == 0) return false;

	// Create file
  FILE *fontearq;
  fontearq = fopen(name, "wt+");
  if(!fontearq) return false;

  // Compute number of chars
  int nchars = ((unsigned int) gcgfont->width / gcgfont->cellwidth) * ((unsigned int) gcgfont->height / gcgfont->cellheight);
  if(nchars + gcgfont->firstASCII > 255) nchars -= nchars + gcgfont->firstASCII - 255;

  // Basic declaration
  fprintf(fontearq, "\nstatic const struct {GCGFONTDATA info; unsigned char charw[%d], basew[%d], data[%d];}", nchars, nchars, (int) (gcgfont->fontdatasize - sizeof(GCGFONTDATA) - nchars - nchars));
  fprintf(fontearq, "\n  %s = { {%d, %d, %d, %d, %d, %d, %d, %d, %d, %d, %d},", name, gcgfont->version, gcgfont->fontdatasize, gcgfont->compression, gcgfont->width, gcgfont->height, gcgfont->cellwidth, gcgfont->cellheight, gcgfont->firstASCII, gcgfont->xoffset, gcgfont->yoffset, gcgfont->charheight);

  // Compute pointers
  unsigned char *charwidths  = &(((unsigned char*) gcgfont)[sizeof(GCGFONTDATA)]);
  unsigned char *basewidths  = &charwidths[nchars];
  unsigned char *fontmap     = &charwidths[nchars + nchars];

  // Write char widths
  fprintf(fontearq, "\n   {");
  for(int i = 0; i < nchars;) {
    fprintf(fontearq, "%d", charwidths[i]);
    if(++i < nchars) fprintf(fontearq, ",");
  }
  fprintf(fontearq, "},");

  // Write base widths
  fprintf(fontearq, "\n   {");
  for(int i = 0; i < nchars;) {
    fprintf(fontearq, "%d", basewidths[i]);
    if(++i < nchars) fprintf(fontearq, ",");
  }
  fprintf(fontearq, "},");

  // Write image data
  unsigned int imagesize = gcgfont->fontdatasize - sizeof(GCGFONTDATA) - nchars - nchars;
  fprintf(fontearq, "\n   {");
  for(unsigned int i = 0; i < imagesize;) {
    if(i > 0 && i % 256 == 0) fprintf(fontearq, "\n    ");
    fprintf(fontearq, "%d", fontmap[i]);
    if(++i < imagesize) fprintf(fontearq, ",");
  }
  fprintf(fontearq, "}\n };");

  // Finished
  fclose(fontearq);

  // Ok, it's written
	return true;
}
